module.exports = "            \r\n                    <div class=\"col-lg-12\">\r\n                        <div class=\"text-center\">\r\n                            <div class= \"fondo\">\r\n                            <h3>Origen de la aplicación</h3>\r\n                            <section>\r\n                                <font color=\"white\"><h4>¿Por qué se creó esta aplicación?</h4>\r\n                                <p>Todo comenzó con la asignatura de Desarrollo de Aplicaciones Web, en el Campus de Móstoles de la URJC (Universidad Rey Juan Carlos). Teníamos que escoger una temática para la aplicación web que deberíamos realizar en la parte práctica de la asignatura, pues el profesor nos había dado total libertad de elección. Pero salimos de la clase sin ideas.</p>\r\n                                <p>Una de las integrantes del grupo, Sandra Timón, no quería desarrollar la típica aplicación web (de música, deportes, etc), de las cuales existen muchas, sino que quería desarrollar algo que no existiese y que, además, tuviera una utilidad más allá de un mero trabajo académico.</p>\r\n                                <p>Un día, hablando Sandra (paciente del síndrome de Wolfram) con su familia, salió el tema de que su asociación necesitaba una aplicación que ayudara a recaudar fondos para poder llevar a cabo los proyectos. </p >\r\n                                <p>Uno de los proyectos más interesantes, liderado por Fumihiko, suponía un coste aproximado de 4.000 euros por paciente, dinero del cual no disponía la asociación para cubrir la atención de sus pacientes (no disponían de ningún tipo de subvención para éste). Y, a raíz de este proyecto, la doctora de la asociación tuvo la idea de que una aplicación que ayudara a recaudar dinero mediante la contribución de todas las personas que estuvieran interesadas en ayudar a la asociación podía ser una solución al problema de falta de recursos.</p>\r\n                                <p>Así pues, Sandra comentó la idea con sus 3 compañeros: Karen, Juan Antonio y Gabriel. A ellos les pareció buena idea y, al fin y al cabo, la idea que tenían en mente era una especie de chat entre médicos y pacientes, tema del mismo ámbito que el que proponía Sandra.</p>\r\n                                    <p>De modo que se pusieron manos a la obra. Bien, primer paso: ¿nombre de la aplicación? Queríamos que contuviera la palabra Wolfram, nombre del síndrome, pero no sabíamos bien qué más añadirle. Así que a Juan Antonio se le ocurrió que podíamos añadirle las iniciales de la asignatura en inglés, WAD (Web Development Aplication) y de ahí surgió el nombre: WADWolfram. El siguiente paso fue recabar información de la asociación, proyectos y necesidades que debería cubrir la aplicación y... ¡listo! Ya solo era ponerse a trabajar y llevarlo a cabo.</p></font>\r\n                            </section>\r\n                            <section>\r\n                                <br>\r\n                                <h4>Sus desarrolladores</h4>\r\n                                <ul>\r\n                                    <h5>Juan Antonio Parés Ponce, estudiante del grado en Ingeniería de Software</h5>\r\n                                    <h5>Karen Príncipe Aguirre, estudiante del doble grado en Ingeniería de Software y Matemáticas</h5>\r\n                                    <h5>Gabriel Rubio Palacios, estudiante del doble grado en Ingeniería de Software e Informática</h5>\r\n                                    <h5>Sandra Timón Mayo, estudiante del grado en Ingeniería de Software</h5>\r\n                                </ul>\r\n                            </section>\r\n\r\n\r\n                        </div>\r\n                    </div>\r\n                   </div>"

